description:
Er is geen probleem dat dit bijzondere stel niet op kan lossen. Dankzij enkele doeltreffende vormveranderingen en een onuitputtelijke fantasie, komen ze altijd uit de moeilijkste situaties... en dat alles zonder hun kalmte te verliezen! Ze staan altijd klaar om te helpen en hun goede wil kent geen grenzen. Bovendien zijn ze de vriendelijke en toegewijde ouders van zeven beweeglijke kinderen : Barbalala, Barbabenno, Barbabella, Barbabee, Barbabientje, Barbabob en Barbaborre.

De verhaaltjes zijn:
Schapen scheren - Weven - De stier - De fles - De wijnoogst
Insecten - De machine - Onherkenbaar - Pottenbakken - De verjaardag
Nillieuvervuilling - De jacht - De picknick - Dieren redden - Weer op aarde

Alle leeftijden!

Audio: French and Dutch

